const findSubstring = require("./subtring-with-concatenation-of-all-words");

describe("tests for leecode 30 - subtring with concatenation of all words", () => {
  it("", () => {
    let s = "barfoothefoobarman";
    let words = ["foo", "bar"];
    let expected = [0, 9];
    let result = findSubstring(s, words);
    expect(result).toEqual(expected);
  });
  it("", () => {
    let s = "foobarfoobar";
    let words = ["foo", "bar"];
    let expected = [0, 6];
    let result = findSubstring(s, words);
    expect(result).toEqual(expected);
  });
  it("", () => {
    let s = "a";
    let words = ["a"];
    let expected = [0];
    let result = findSubstring(s, words);
    expect(result).toEqual(expected);
  });
  it("", () => {
    let s =
      "";
    let words = [
      "dhvf",
      "sind",
      "ffsl",
      "yekr",
      "zwzq",
      "kpeo",
      "cila",
      "tfty",
      "modg",
      "ztjg",
      "ybty",
      "heqg",
      "cpwo",
      "gdcj",
      "lnle",
      "sefg",
      "vimw",
      "bxcb",
    ];
    let expected = [0];
    let result = findSubstring(s, words);
    expect(result).toEqual(expected);
  });
});
